  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned DEFAULT NULL COMMENT '关联买家ID',
  `seller_id` int(10) unsigned DEFAULT NULL COMMENT '关联卖家ID',
  `type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单类型(1：现货; 2：期货; 3：特卖）',
  `order_sn` varchar(255) COLLATE utf8_unicode_ci DEFAULT '000000000' COMMENT '订单号',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总额',
  `status` int(10) NOT NULL DEFAULT '0' COMMENT '订单状态（-1：待签约; 1：待付款（现货）; 2：待付首款（期货）; 3：待付尾款（期货）；4.待发货;5：待收货；6：待结算；7：待开票；8：已开发票；9：待评价；99：交易完成（售后介入处理中）；100：取消订单',
  `paid_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已支付金额',
  `detail` text COLLATE utf8_unicode_ci NOT NULL COMMENT '详细说明',
  `linkman` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系人姓名',
  `mobile` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系手机号',
  `address` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收货地址',
  `zip_code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邮编',
  `receive_type` tinyint(4) DEFAULT '1' COMMENT '提货方式，1自提，2送货上门',
  `technology` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'receive_type=2的时候 工艺',
  `pay_type` tinyint(4) DEFAULT '1' COMMENT '付款方式：1.全额付款 2.货到付款',
  `send_type` tinyint(4) DEFAULT '1' COMMENT '期货推送方式，1自动推送，2选择商家推送',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  `postsge` decimal(10,2) DEFAULT '0.00' COMMENT '邮费',
  `invoice_type` tinyint(4) DEFAULT '2' COMMENT '发票类型：1.增值税发票2.普通发票',
  `invoice_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票--购买方名称',
  `invoice_no` int(30) DEFAULT NULL COMMENT '发票--纳税人识别号',
  `invoice_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票--购买方地址',
  `invoice_tel` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票---购买方电话',
  `invoice_bank` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票--购买方开户行',
  `invoice_bank_num` int(30) DEFAULT NULL COMMENT '发票--购买方 银行账号',
  `invoice_send_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票邮寄地址',
  `receive_code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收货码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=190 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单表（现货期货共用）';

-- ----------------------------
-- Records of gt_orders
