  `realname_auth` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '实名认证（默认为0，未认证）',
  `credit_degree` int(10) unsigned DEFAULT '0' COMMENT '买家信誉等级',
  `avatar_pic` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '头像图片',
