  `remember_token` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '自动登录token（记住我）',
  `role_id` tinyint(10) DEFAULT NULL COMMENT '角色',
  `user_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '用户状态 1.启用 -1禁用',
